import React from 'react';
import { Input, Form, Button, List, Card, Icon} from 'antd';

const Profile = () => {
    return (
        <div>
            <Form style={{marginBottom: '20px', border: '1px solid #d9d9d9', padding: '20px'}}>
                <Input addonBefore="Nickname" />
                <Button type="primary">fix</Button>
            </Form>
            <List 
                style={{ marginBottom: '20px' }}
                grid={{ gutter: 4, xs: 2, md: 3 }}
                size="small"
                header={<div>follower list</div>}
                loadMore={<Button style={{width: "100%"}}> more </Button>}
                bordered
                dataSource={['dd', 'aa', 'bcc']}
                renderItem={Item => (
                    <List.Item style={{marginTop: '20px'}}>
                        <Card actions={[<Icon type="stop" />]}>
                            <Card.Meta description={item} />
                        </Card>
                    </List.Item>
                )}
            />
            <List 
                style={{ marginBottom: '20px' }}
                grid={{ gutter: 4, xs: 2, md: 3 }}
                size="small"
                header={<div>following list</div>}
                loadMore={<Button style={{width: "100%"}}> more </Button>}
                bordered
                dataSource={['dd', 'aa', 'bcc']}
                renderItem={Item => (
                    <List.Item style={{marginTop: '20px'}}>
                        <Card actions={[<Icon type="stop" />]}>
                            <Card.Meta description={item} />
                        </Card>
                    </List.Item>
                )}
            />
        </div>
    );
};

export default Profile;
